/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_avg_height` AFTER UPDATE ON `players` FOR EACH ROW BEGIN
    IF OLD.altura <> NEW.altura THEN
        UPDATE rankings r
        SET r.altura_promedio = (
            SELECT AVG(p.altura)
            FROM players p
            WHERE p.country_id = NEW.country_id
        )
        WHERE r.country_id = NEW.country_id;
    END IF;
END */;;
