/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_total_market_value` AFTER UPDATE ON `players` FOR EACH ROW BEGIN
    IF OLD.valor_mercado <> NEW.valor_mercado THEN
        UPDATE rankings r
        SET r.valor_total = (
            SELECT SUM(p.valor_mercado)
            FROM players p
            WHERE p.country_id = NEW.country_id
        )
        WHERE r.country_id = NEW.country_id;
    END IF;
END */;;
